contract smartContract is Ownable {
    using SafeMath for uint256;
    address public AdminAddress;
    Token public Coin;
    uint256 investerID;
    bool public initialized;

    mapping(address => mapping(uint256 => purchaseInfo)) private buyInfo;
    mapping(address => uint256[]) getIDByAddress;

    struct purchaseInfo {
        uint256 ID;
        uint256 buyTime;
        uint256 purchaseToken;
        uint256 ownerSurplus;
        uint256 BNBchargedByAdmin;
    }

    function initialize(
        Token _Coin,
        address _adminAddress,
        uint256 amount
    ) public onlyOwner {
        require(initialized != true, "Already Initialized");
        Coin = Token(_Coin);
        AdminAddress = address(_adminAddress);
        Coin.transferPrice(owner(), _adminAddress, amount);
        initialized = true;
    }

    function setAdminAddress(address _admin) public onlyOwner {
        AdminAddress = _admin;
    }

    function totalInvesters() public view returns (uint256) {
        return investerID;
    }

    function getIdsOfUser(address user) public view returns (uint256[] memory) {
        return getIDByAddress[user];
    }

    function buyInformation(uint256 id)
        public
        view
        returns (
            uint256 ID,
            uint256 buyTime,
            uint256 purchaseToken,
            uint256 ownerSurplus,
            uint256 BNBchargedByAdmin
        )
    {
        return (
            buyInfo[msg.sender][id].ID,
            buyInfo[msg.sender][id].buyTime,
            buyInfo[msg.sender][id].purchaseToken,
            buyInfo[msg.sender][id].ownerSurplus,
            buyInfo[msg.sender][id].BNBchargedByAdmin
        );
    }

    function buyToken(uint256 amount) public payable {
        require(
            Coin.balance(AdminAddress) > amount,
            "Error: Admin does not have enough balance"
        );
        Coin.transferPrice(AdminAddress, msg.sender, amount);
        unchecked {
            investerID++;
        }
        uint256 id = investerID;
        buyInfo[msg.sender][id].ID = investerID;
        buyInfo[msg.sender][id].buyTime = block.timestamp;
        buyInfo[msg.sender][id].purchaseToken = amount;
        uint256 ownerSurplusToAdmin = amount.div(2);
        require(
            Coin.balance(owner()) > ownerSurplusToAdmin,
            "Error: Owner does not have enough balance"
        );
        Coin.transferPrice(owner(), AdminAddress, ownerSurplusToAdmin);
        buyInfo[msg.sender][id].ownerSurplus = ownerSurplusToAdmin;
        getIDByAddress[msg.sender].push(id);
        address(msg.sender) == AdminAddress;
        msg.value == (1 * ownerSurplusToAdmin).div(10000000000);
        payable(owner()).transfer(msg.value);
        buyInfo[msg.sender][id].BNBchargedByAdmin = msg.value;
    }
}

